package com.aspire.daydreaming.bundle.myActivity;/** * @Name: MyActivityPresenter * @Author: yeliang * @Date: 2016/8/24 */public class MyActivityPresenter extends MyActivityContract.Presenter {    @Override    public void getActivities() {        rxManager.add(mModel.getActivities().subscribe(activityInfoData -> {            mView.onComplete(activityInfoData);        }, throwable -> {            mView.onError(throwable.getMessage());        }));    }}